import React from 'react'
import changelog from '../../actions/changelog'

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            changelog: [],
            requestStatusDataPage: "Unknown"
        }
    }

    componentDidMount() {
        document.title = 'Charlinfo | Home';
        changelog.get()
            .then((data) => {
                console.log(data)
                this.setState({
                    changelog: data.changelog,
                    requestStatusDataPage: data.status
                })
            })
    }

    render() {

        console.log(this.state)

        return (
            <div className="m-5">
                <h1 className="text-center m-4">Accueil</h1>
                {this.state.requestStatusDataPage === "Error" && (
                    <h3 className="text-center">Erreur de chargement</h3>
                )}
                {this.state.requestStatusDataPage === "Succes" && (
                    this.state.changelog.map((data) => (
                            <div key={data.title}>
                                <h4>{data.title}</h4>
                                <ul className="list-group list-group-flush mb-4">
                                    {data.description.map((description) => (
                                        <li key={description} className="list-group-item">{description}</li>
                                    ))}
                                </ul>
                            </div>
                        ))
                )}
            </div>
        )
    }
}

export default Home
